// lcd从scale3获取并且显示,默认是双镜头(实际取决于scale3_msi内部实现)
// 暂时没有接口修改scale3是从buf0还是从buf1获取,所以scale3内部要和vpp匹配
void lcd_from_scale3(void *d)
{
    struct msi *scale3 = scale3_msi(S_PREVIEW_SCALE3);
    if (scale3)
    {
        msi_add_output(scale3, NULL, R_VIDEO_P1);
        msi_add_output(scale3, NULL, R_VIDEO_P0);
    }
}

// lcd从虚拟video拿数据显示
void lcd_from_sim_video(void *d)
{
    // 接口参数,top代表P0在底层还是P1在顶层
    // sim_video_msi是虚拟屏幕,接收P0和P1,通过dma2d去合并
    struct msi *sim_video = sim_video_msi("sim_video", 800, 480, 0);
    if (sim_video)
    {
        msi_add_output(sim_video, NULL, R_VIDEO_P0); // sim_video输出到R_VIDEO_P0的msi
    }

    // 将scale3的数据发送到sim_video,然后sim_video去dam2d去重新组成一张图给到lcd显示
    struct msi *scale3 = scale3_msi(S_PREVIEW_SCALE3);
    if (scale3)
    {
        msi_add_output(scale3, NULL, "sim_video"); // scale3输出到sim_video的msi     即scaler3--->sim--->r_video_p0
    }
}

