// 可以显示更多的图片
void lcd_from_sim_video_more(void *d)
{
    static const uint16_t filter[]  = {FSTYPE_YUV_P0, FSTYPE_YUV_P1, FSTYPE_YUV_P2, FSTYPE_YUV_SIM_P0, FSTYPE_YUV_SIM_P1, FSTYPE_NONE};
    // 可以显示更多的图(通过filter去设置,每一张图都会合并,多摄像头可以参考)
    struct msi           *sim_video = sim_video_more_msi("sim_video", 800, 480, (uint16_t *) filter);
    if (sim_video)
    {
        msi_add_output(sim_video, NULL, R_VIDEO_P0);
    }

    struct msi *sim_decode_jpg_msi = route_msi(ROUTE_USB);
    if (sim_decode_jpg_msi)
    {
        sim_decode_jpg_msi->enable = 1;
        msi_add_output(sim_decode_jpg_msi, NULL, SR_OTHER_JPG_USB1);
        msi_add_output(sim_decode_jpg_msi, NULL, SR_OTHER_JPG_USB2);
    }

    // 将scale3的数据发送到sim_video,然后sim_video去dam2d去重新组成一张图给到lcd显示
    struct msi *scale3 = scale3_msi(S_PREVIEW_SCALE3);
    if (scale3)
    {
        msi_add_output(scale3, NULL, "sim_video");
    }

    // 创建解码的msi模块,然后解码完成会给到sim_video(只要类型匹配,就可以接收显示)
    struct msi *decode_msi = jpg_decode_msi(S_JPG_DECODE);
    if (decode_msi)
    {
        msi_add_output(decode_msi, NULL, "sim_video");
    }

    // 创建解码流,然后给到解码模块,解码模块会根据这个信息配置解码参数以及类型
    struct msi *decode_msg_msi_SIM_P0 = jpg_decode_msg_msi(SR_OTHER_JPG_USB1, 320, 180, 320, 180, 0);
    if (decode_msg_msi_SIM_P0)
    {
        // 配置解码的坐标值
        msi_do_cmd(decode_msg_msi_SIM_P0, MSI_CMD_DECODE_JPEG_MSG, MSI_JPEG_DECODE_FORCE_TYPE, FSTYPE_YUV_SIM_P0);
        msi_do_cmd(decode_msg_msi_SIM_P0, MSI_CMD_DECODE_JPEG_MSG, MSI_JPEG_DECODE_X_Y, 0 << 16 | 180);
        msi_add_output(decode_msg_msi_SIM_P0, NULL, S_JPG_DECODE);
    }

    struct msi *decode_msg_msi_SIM_P1 = jpg_decode_msg_msi(SR_OTHER_JPG_USB2, 320, 180, 320, 180, FSTYPE_USB_CAM1);
    if (decode_msg_msi_SIM_P1)
    {

        msi_do_cmd(decode_msg_msi_SIM_P1, MSI_CMD_DECODE_JPEG_MSG, MSI_JPEG_DECODE_FORCE_TYPE, FSTYPE_YUV_SIM_P1);
        // 配置解码的坐标值
        msi_do_cmd(decode_msg_msi_SIM_P1, MSI_CMD_DECODE_JPEG_MSG, MSI_JPEG_DECODE_X_Y, 320 << 16 | 180);
        msi_add_output(decode_msg_msi_SIM_P1, NULL, S_JPG_DECODE);
    }

    // 上面是基础,下面是模拟jpg数据来源给到解码(可以从usb、文件),模拟就采用scal3的数据通过gen420编码,然后再解码
    // scale3的数据给到gen420去编码
    if (scale3)
    {
        msi_add_output(scale3, NULL, "gen420");
    }
}

// 虚拟从文件读取jpg图解码数据,这里只是简单的demo,没有对数据内存释放管理
void lcd_from_sim_file_decode(void *d)
{
    struct framebuff *fb                 = NULL;
    struct msi       *sim_decode_jpg_msi = msi_new("sim_decode", 0, NULL);
    if (sim_decode_jpg_msi)
    {
        sim_decode_jpg_msi->enable = 1;
        msi_add_output(sim_decode_jpg_msi, NULL, SR_OTHER_JPG_USB1);
    }

    // 创建解码的msi模块,然后解码完成会给到sim_video(只要类型匹配,就可以接收显示)
    struct msi *decode_msi = jpg_decode_msi(S_JPG_DECODE);
    if (decode_msi)
    {
        // 给到P0显示
        msi_add_output(decode_msi, NULL, R_VIDEO_P0);
    }

    // 创建解码流,因为给P0显示,所以类型是FSTYPE_YUV_P0
    struct msi *decode_msg_msi_P0 = jpg_decode_msg_msi(SR_OTHER_JPG_USB1, 320, 180, 320, 180, FSTYPE_JPG_FILE);
    if (decode_msg_msi_P0)
    {
        // 给到P0显示
        msi_do_cmd(decode_msg_msi_P0, MSI_CMD_DECODE_JPEG_MSG, MSI_JPEG_DECODE_FORCE_TYPE, FSTYPE_YUV_P0);
        // 配置解码的坐标值
        msi_do_cmd(decode_msg_msi_P0, MSI_CMD_DECODE_JPEG_MSG, MSI_JPEG_DECODE_X_Y, 0 << 16 | 0);
        msi_add_output(decode_msg_msi_P0, NULL, S_JPG_DECODE);
    }

    uint8_t *jpg_buf = (uint8_t *) os_malloc_psram(sizeof(test_jpg_800_480));
    hw_memcpy(jpg_buf, test_jpg_800_480, sizeof(test_jpg_800_480));
    sys_dcache_clean_range((uint32_t *) jpg_buf, sizeof(test_jpg_800_480));
    while (sim_decode_jpg_msi && jpg_buf)
    {
        fb = fb_alloc(jpg_buf, sizeof(test_jpg_800_480), F_JPG << 8 | FSTYPE_JPG_FILE, sim_decode_jpg_msi);
        if (fb)
        {
            msi_output_fb(sim_decode_jpg_msi, fb);
            // os_printf("%s success:%d\n", __FUNCTION__, success);
        }
        os_sleep_ms(40);
    }
}

