// 可以拍照并且生成缩略图
// 但是不能图传jpg,如果需要图传jpg,这里代码需要修改,所以这里仅仅支持拍照
// h264不会受影响,从vpp buf0获取数据拍照,然后用jpg1和gen420去生成缩略图
// 所以这里用了的模块有:vpp jpg0 jpg1 gen420
#include "lib/net/eloop/eloop.h"
void takephoto_demo(void *e, void *d)
{
    struct event      *ei            = (struct event *) e;
    int                t_socket      = (int) ei->ev.fd.fd;
    struct msi        *jpg_thumb_msi = (struct msi *) d;
    unsigned int       retval        = sizeof(struct sockaddr_in);
    struct sockaddr_in remote_addr;
    int                nRecev;
    uint8_t            recv_buf[64];
    nRecev = recvfrom(t_socket, (char *) recv_buf, sizeof(recv_buf), 0, (struct sockaddr *) &remote_addr, (socklen_t *) &retval);
    if (nRecev > 0)
    {
        recv_buf[nRecev] = 0;
        if (recv_buf[0] == '0')
        {
            // 接收到数据就拍照
            os_printf("=====================%s:%d\n", __FUNCTION__, __LINE__);
            os_printf("+++++++++++++freemem:%d\r\n", sysheap_freesize(&sram_heap));

            // uint32_t buf[256];
            // sysheap_status(&sram_heap,buf,sizeof(buf)/4,0);

            msi_do_cmd(jpg_thumb_msi, MSI_CMD_JPG_THUMB, MSI_JPG_THUMB_TAKEPHOTO, 100);
            os_printf("XXXXXXXXfreemem:%d\r\n", sysheap_freesize(&sram_heap));
        }
        else if (recv_buf[0] == '1')
        {

            // 1后面紧接文件名,缩略图
            uint32_t filesize;
            uint8_t *jpg_buf = (uint8_t *) jpg_file_read((const char *) &recv_buf[1], 1, (int32_t *) &filesize);
            os_printf("thumb jpg_buf:%X\n", jpg_buf);
            if (jpg_buf)
            {
                os_printf("thumb filesize:%d\n", filesize);
                jpg_file_free(jpg_buf);
            }
        }
        else if (recv_buf[0] == '2')
        {
            // 2后面紧接文件名,原图
            uint32_t filesize;
            uint8_t *jpg_buf = (uint8_t *) jpg_file_read((const char *) &recv_buf[1], 0, (int32_t *) &filesize);
            os_printf("original jpg_buf:%X\n", jpg_buf);
            if (jpg_buf)
            {
                os_printf("original filesize:%d\n", filesize);
                jpg_file_free(jpg_buf);
            }
        }
        else if (recv_buf[0] == '3')
        {
            os_printf("==========freemem:%d\r\n", sysheap_freesize(&sram_heap));
            char *path_json = photo_json_path();
            if (path_json)
            {
                os_printf("path json:%s\n", path_json);
            }
            else
            {
                os_printf("no found photo\n");
            }

            path_json_free(path_json);
        }
        else
        {
            os_printf("%s:%d\trecv not idenity:%s\n", __FUNCTION__, __LINE__, recv_buf);
        }
    }
    return;
}

// 打开mjpeg,固定msi名字,后续绑定使用msi名字取绑定
// 内部自动决定是否打开mjpeg
void auto_jpg_run(void *d)
{
    struct msi *gen420_msi    = auto_jpg_msi_init(AUTO_JPG, JPGID0, VPP_DATA0);
    struct msi *jpg_thumb_msi = jpg_thumb_msi_init(R_JPG_THUMB, FSTYPE_JPG_CAMERA0, 0);
	(void)jpg_thumb_msi;
    if (gen420_msi)
    {
        msi_add_output(gen420_msi, NULL, R_JPG_THUMB); // 拍照缩略图
    }
}

